import React from 'react'
import axios from 'axios';

export default function Exit() {


    async function exitFunc() {
        const options = {
            url: 'http://localhost:9000/exit',
            method: 'POST',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json;charset=UTF-8'
            },
            data: JSON.stringify({
                exit: true
            })
        };

        await axios(options)
        // .then((response) => { alert('Data Basarili bir sekilde gonderildi') });
    }


    return <>


        <button type='button' onClick={exitFunc}>Güvenli çıkış yap.</button>


    </>;
}
